exports=async function(bid,options){const{parseUpdate}=await require("transcode/parse_update");return parseUpdate(`https://www.xstt5.com/${bid}/`,html=>{const name=html.subRegexLast(/li><a[^>]*href="[^"]+\d+\.html"[^>]*>([^<]+)</g),updateTime=html.subRegex(/li> 更新时间：([^<]+)</);return {name,updateTime}},{clientOptions:{...(options&&options.clientOptions),"x-mobile":0}})};